import React from 'react';
import '../styles/hero_section.css';

const Projects = () => {
    return (
        <section className='hero-container'>
            <h1>Alanna Mathieu</h1>
            <p>Web Developer at <span>Travelopia</span></p>
            <p>Fullstack student at <span>Lambda School</span></p>
        </section>
    )
}

export default Projects;
